2010 Harley-Davidson (HD) Forty-Eight XL1200X Sportster, 1200cc, 5 speed, Vivid black with Gold flake gas tank, black laced steel wheels. Only 2835 miles on the bike. Needless to say with the low miles the tires are in excellent shape. Recent oil change. Nearly $1,500 in extras. EXTRAS; HD windscreen, Vance & Hines black 3" slip on mufflers, HD pipe wraps, HD Screaming Eagle round Sportster Stage 1 air cleaner kit, HD wrinkle black derby cover, HD wrinkle black chain inspection cover, HD black leather solo seat.  Bike is in excellent condition I just dont have the time to ride as much as i would like and I will soon be moving out of state.  Asking 9250 OBO, could be interested in trades for aluminum welded fishing boat minimum size 16' and must be complete motor/boat/trailer no parts and pieces please.

Harley Davidson offers easy financing if you need just follow the link below;
http://www.harley-davidson.com/content/h-d/en_US/home/owners/financing-and-insurance/private-party-financing.html
